import React from "react";
import PropTypes from 'prop-types';

//@material-ui/core components
import withStyles from "@material-ui/core/styles/withStyles";
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';



import CountStyle from "assets/jss/material-kit-react/view/landingPageSections/countStyle.jsx";
import aboutMeStyle from "assets/jss/material-kit-react/view/landingPageSections/aboutMeStyle.jsx";



const CountSection = ({...props}) => {
	const { classes } = props;
	return(
		<div className={classes.section}>
			<div className={classes.root}>
		      <Grid container spacing={24}>
		        <Grid item xs={6} sm={3}>
		          <h6>working!!</h6>
		        </Grid>
		        <Grid item xs={6} sm={3}>
		          <h6>working!!</h6>
		        </Grid>
		        <Grid item xs={6} sm={3}>
		          <h6>working!!</h6>
		        </Grid>
		        <Grid item xs={6} sm={3}>
		          <h6>working!!</h6>
		        </Grid>
		      </Grid>
		    </div>
		</div>
	);
}

CountSection.propTypes = {
	classes: PropTypes.object.isrequired
}

export default withStyles(CountStyle)(CountSection);
